#include <stdio.h>
#include <stdbool.h>
#include <string.h>

#define MAX(a, b) ((a) > (b) ? (a) : (b))

// solution 1: brute force
bool isUnique (const char *s, int start, int end)
{
    bool bitmap[128] = {0};

    for (int ii = start; ii <= end; ii++) {
        if (bitmap[s[ii]]) {
            return false;
        } else {
            bitmap[s[ii]] = true;
        }
    }
    return true;
}


int lengthOfLongestSubstring (const char * s)
{
    int maxLen = 1;
    int len = strlen(s);


    if (!len)
        return 0;

    for (int ii = 0; ii < len - 1; ii++) {
        for (int jj = ii + 1; jj < len; jj++) {
            if (isUnique(s, ii, jj)) {
                maxLen = MAX(maxLen, jj - ii + 1);
            }
        }
    }

    return maxLen;
}


// solution 2: first expand the window as long as possible
// and then keep searching valid window >= to that initial
// length
int lengthOfLongestSubstring (const char * s)
{
    int maxLen = 1;
    int len = strlen(s);
    int start = 0;
    int end = start + 1;


    if (!len)
        return 0;

    while (end < len) {
        if (isUnique(s, start, end)) {
            maxLen = MAX(maxLen, end - start + 1);
        } else {
            start++;
        }
        end++;
    }

    return maxLen;
}


// solution 3
// the basic idea is, keep a hashmap which stores the characters in string as keys and their positions as values,
// and keep two pointers which define the max substring. move the right pointer to scan through the string,
// and meanwhile update the hashmap. If the character is already in the hashmap, then move the left pointer to the
// right of the same character last found. Note that the two pointers can only move forward.
#define ARRAY_SIZE(x) (sizeof(x) / sizeof(x[0]))

int lengthOfLongestSubstring (const char * s)
{
    int maxLen = 0;
    int len = strlen(s);
    int start = 0;
    int end = start;
    int map[128] = {0};


    if (!len)
        return 0;


    for (int end = start; end < len; end++) {
        if (map[s[end]] >= 0) {
            start = MAX(start, map[s[end]]);
        }

        // map[] keeps track of the last position + 1 of the current char
        map[s[end]] = end + 1;

        maxLen = MAX(maxLen, end - start + 1);
    }

    return maxLen;
}





